import React from 'react'

const Todo = ({key, todo}) => {
  const {id, title, desc} = todo;  
  return (
    <div>
        <article>
            <div>
                <h3>{title}</h3>
                <p>{desc}</p>
            </div>
        </article>
    </div>
  )
}

export default Todo
